import React, { useEffect,useContext, useState } from 'react';
import axios from 'axios';
import ChitForm from './ChitsForm';
import { ChitsContext } from '../../Context/ChitsContext'
import { Button, Modal, ModalHeader, ModalBody } from 'reactstrap';

export default function ChitList() {
    const {chits, chitDispatch} = useContext(ChitsContext);
    const [modal, setModal] = useState(false);
    const [editId, setEditId] = useState('');
    const toggle = () => setModal(!modal);
    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get('http://localhost:3009/api/chits');
                chitDispatch({ type: 'SET_CHIT', payload: response.data });
                console.log(response)
            } catch (err) {
                console.log(err);
            }
        };

        fetchData();
    }, [chitDispatch]);
    const handleRemove = async (id) => {
        const confirmation = window.confirm('Are you sure?');
        if (confirmation) {
            try {
                const response = await axios.delete(`http://localhost:3009/api/chits/${id}`);
                console.log(response.data);
                chitDispatch({ type: 'DELETE_CHIT', payload: id });
            } catch (err) {
                console.log(err);
            }
        }
    };

    const handleEdit = (id) => {
        setEditId(id);
        toggle();
    };

    return (
        <div>
            <h2>Chits - {chits.data.length}</h2>

            <table>
                <thead>
                    <tr>
                       
                        <th>Chit Amount</th>
                        <th>Installments</th>
                        <th>Total Amount</th>
                        <th>Start Date</th>
                        <th>End Date</th>
                        <th>Status</th>
                        <th>Benefits</th>
                        <th>Terms and Conditions</th>
                        <th>Gold Price</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                {chits && chits.data.map((ele,i)=>{
    <tr key={chits._id}>
        <td>{ele.chitAmount}</td>
        <td>{ele.installments}</td>
        <td>{ele.totalAmount}</td>
        <td>{ele.date && ele.date.startDate}</td>
        <td>{ele.date && ele.date.endDate}</td>
        <td>{ele.status}</td>
        <td>{ele.benefits}</td>
        <td>{ele.termsAndConditions}</td>
        <td>{ele.goldPrice}</td>
        <td>
            <button onClick={() => handleEdit(ele._id)}>Edit</button>
            <button onClick={() => handleRemove(ele._id)}>Remove</button>
        </td>
    </tr>
                    })}


                </tbody>
            </table>
           
<Button color="danger" onClick={toggle}>Add Chit</Button>
            <Modal isOpen={modal} toggle={toggle}>
                <ModalHeader toggle={toggle}>Chit Form</ModalHeader>
                <ModalBody>
                    <ChitForm editId={editId} toggle={toggle} />
                </ModalBody>
            </Modal>
        </div>
    );
}
